import React from "react";

const Message = () => {
  return (
    <div className="message">
      <div className="messageInfo">
        <img
          src="https://i.pinimg.com/736x/aa/1c/f1/aa1cf191b93993aced84fc0302121deb.jpg"
          alt=""
        />
        <span>just now</span>
      </div>

      <div className="messageContent">
        <p>Hello Amal</p>
        {/* <img
          src="https://i.pinimg.com/736x/aa/1c/f1/aa1cf191b93993aced84fc0302121deb.jpg"
          alt=""
        /> */}
      </div>
    </div>
  );
};

export default Message;
